import React, { Component } from 'react';
import Nav from './components/Nav'
import NotFound from './components/NotFound'
import './index.css';

import {
  BrowserRouter,
  Route,
  Switch
} from 'react-router-dom';

import apiKey from './config'

class App extends Component {

  constructor() {
    super();
    this.state = {
      photos: []
    };
  }

  componentDidMount() {

  }

  render() {
    return (
    <BrowserRouter>
      <div class="container">

        <Switch>
          <Route exact path="/waterfalls" component={Nav}/>
          <Route path="/dogs" component={Nav}/>
          <Route path="/desert" component={Nav}/>
          <Route component={NotFound}/>
          </Switch>
          </div>
    </BrowserRouter>
  );
}
}

export default App;
